import React from 'react';
import classes from './Headercomponent.module.css';

const Headercomponent = () =>{

return (

    <React.Fragment>

<header className={classes.header}>
    <h1>Meals</h1>
    <button>Cart</button>
</header>
<div className={classes['main-image']}>
    <img src='https://raw.githubusercontent.com/academind/
    react-complete-guide-code/11-practice-food-order-app/extra-files/meals.jpg'></img>
</div>



    </React.Fragment>

)



}


export default Headercomponent;
